import './main-page.css';
import profile_image from '../../images/profile_image.png';
import main_icon from '../../images/mail_icon.png';
import phone_icon from '../../images/phone_icon.png';
import { FaQuestionCircle } from "react-icons/fa";
import styled from 'styled-components'
import { useState } from "react";
import ToggleButton from '@mui/material/ToggleButton';
import i18n from '../../language/i18n';
import { useTranslation } from "react-i18next";

function MainPage() {
  const [darkFlag, setDarkState] = useState(true);

  // 카카오 브라우저로 오픈 시 외부 브라우저 사용
  const currentInfo = window.navigator.userAgent.toLowerCase();
  if (currentInfo.indexOf('kakaotalk') !== -1) {
    var target_url = 'http://resume-ym.duckdns.org';
    window.location.href = 'kakaotalk://web/openExternal?url='+encodeURIComponent(target_url);
  }

  // 언어 변경
  const langList = [
    { value: "en", name: "English" },
    { value: "ko", name: "한국어" }
  ];
  const [selectedLang, setSelectedLang] = useState("ko");
  const handleSelectLang = (e) => {
    setSelectedLang(e.target.value);
    i18n.changeLanguage(e.target.value);
  };
  // const onChangeLang = () => {
  //   i18n.language === "ko"
  //     ? i18n.changeLanguage("en")
  //     : i18n.changeLanguage("ko");
  // };

  return (
    <div className={`main-test ${darkFlag ? 'darkTheme' : 'lightTheme'}`}>
      <div className="topLine">
        <ToggleButton
          className="toggleSwitch"
          selected={darkFlag}
          onChange={() => {
            setDarkState(!darkFlag);
          }}
        >
          {darkFlag ? 'Light Mode' : 'Dark Mode'}
        </ToggleButton>
        <select
          className="langSelect"
          onChange={handleSelectLang} value={selectedLang}
        >
          {langList.map((item) => {
            return <option value={item.value} key={item.value} style={{backgroundColor: "rgba(255, 255, 255, 0)"}}>
              {item.name}
            </option>;
          })}
        </select>
      </div>
      <div><ProfileInfo/></div>
      <div><HLine /></div>
      <div><Introduce/></div>
      <br/><br/>
      <div><Skill/></div>
      <br/><br/>
      <div><WorkExp/></div>
      <br/><br/>
      <div><Project/></div>
      <br/><br/>
      <div><Education/></div>
      <br/><br/>
      <div><License/></div>
      <br/><br/>
      <div><ETC/></div>
      <br/><br/>
    </div>
  );
}

function HLine() {
  return (
    <div className="h-line"></div>
  );
}

function ProfileInfo() {
  return (
    <div className="profile-info">
      <img className="my-image" src={profile_image}/>
      <div className="description">
        <div className="my-name">성여명</div>
        <div className="line" style={{marginTop: "3%"}}>
          <img src={phone_icon}/> 010-4200-7897
        </div>
        <div className="line">
          <img src={main_icon}/>yeomyeong26@gmail.com
        </div>
      </div>
    </div>
  );
}

function Introduce() {
  const { t } = useTranslation();

  return (
    <div className="introduce">
      <div className="header">INTRODUCE</div>
      <div className="content">
      <h2>{t("testText")}</h2>
      Node.js, TypeScript, JavaScript, HTML, CSS, MySQL 등을 활용한 웹 프론트엔드 및 백엔드 개발에 3년의 경험을 보유하고 있습니다. 실시간 모니터링을 위한 웹 서비스를 개발하는 프로젝트에 참여하면서 복잡한 기능들을 개발한 경험을 가지고 있습니다.
      <br/><br/>
